// src/components/CostEstimationTable.js
import React from 'react';
import './CostEstimationTable.css'; // Import the CSS file for styling

function CostEstimationTable({ results }) {
    return (
        <div className="table-container">
            <h3 className="table-title">Cost Estimation Results</h3>
            <table className="estimation-table">
                <thead>
                    <tr>
                        <th>Task</th>
                        <th>Subtask</th>
                        <th>Development Hours</th>
                        <th>Comments/Notes</th>
                    </tr>
                </thead>
                <tbody>
                    {results.map((item, index) => (
                        <tr key={index}>
                            <td>{item.task}</td>
                            <td>{item.subtask || 'N/A'}</td>
                            <td>{item.hours}</td>
                            <td>{item.comments}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
}

export default CostEstimationTable;
